import{_ as e,o as t,c as a,R as c}from"./chunks/framework.zUbWieqp.js";const f=JSON.parse('{"title":"2.物理专线","description":"","frontmatter":{},"headers":[],"relativePath":"guide/cloud/aws/vpc/6-Direct_Connect.md","filePath":"guide/cloud/aws/vpc/6-Direct_Connect.md","lastUpdated":1701247404000}'),r={name:"guide/cloud/aws/vpc/6-Direct_Connect.md"},o=c('<p><a href="https://docs.aws.amazon.com/directconnect/latest/UserGuide/direct-connect-gateways-intro.html" target="_blank" rel="noreferrer">https://docs.aws.amazon.com/directconnect/latest/UserGuide/direct-connect-gateways-intro.html</a></p><p><a href="https://www.infoq.cn/article/8NOC5dAW6UcQd3mewsEt" target="_blank" rel="noreferrer">https://www.infoq.cn/article/8NOC5dAW6UcQd3mewsEt</a></p><p><a href="https://cloud.tencent.com/developer/article/1825000" target="_blank" rel="noreferrer">https://cloud.tencent.com/developer/article/1825000</a></p><h1 id="_2-物理专线" tabindex="-1">2.物理专线 <a class="header-anchor" href="#_2-物理专线" aria-label="Permalink to &quot;2.物理专线&quot;">​</a></h1><p>物理专线是用户本地数据中心与接入点的运营商物理网络的专线连接。用户可以申请普通物理专线和托管物理专线。</p><p>普通物理专线，是端口带宽资源被用户独占的物理专线，此种类型的物理专线由用户单独使用该物理线路，专线用户可以创建多个虚拟接口。</p><p>托管物理专线，是多个用户共享端口资源的物理专线，此种类型的物理专线由合作伙伴创建，合作伙伴指定托管物理专线的VLAN，此类型的专线只允许用户创建一个虚拟接口。</p><p>合作伙伴可以申请创建运营物理专线，用户通过合作伙伴申请创建托管物理专线，需要合作伙伴在运营物理专线上分配VLAN和带宽资源。</p>',8),n=[o];function s(d,i,p,_,l,h){return t(),a("div",null,n)}const u=e(r,[["render",s]]);export{f as __pageData,u as default};
